  false,\n\t\"url\": null,\n\t\"notes\": \" n        The school rehabilitation activity
  seeks to decrease student and teacher absenteeism, increase studentsu2019 time on
  task, and, ultimately, improve learning and labor market outcomes.  We propose a
  mixed-methods study design, with three components: (1) a process evaluation examining
  the programu2019s implementation and costs; (2) a randomized controlled trial (RCT)
  impact evaluation using a school-level stratified random assignment design, and
  (3) in-depth analysis of the relationship between changes in school infrastructure
  and changes in the learning environment, using qualitative methods in a subset of
  study schools.n      \",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
